import logo from './logo.svg';
import './App.css';
import Navbar from "./Components/Navbar"
import Home from './Routes/Home';
import { Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route element={<Home/>}/>
        </Routes>

    <Navbar/>
    <Home/>
    </div>
  );
}

export default App;
